using NesCs.Common.Tests;

namespace NesCs.UnitTests.Cpu;

public class MathInstructionsInCpuMust
{
    [Theory]
    [MemberData(nameof(Opcode61JsonFeeder))]
    [MemberData(nameof(Opcode65JsonFeeder))]
    [MemberData(nameof(Opcode69JsonFeeder))]
    [MemberData(nameof(Opcode6DJsonFeeder))]
    [MemberData(nameof(Opcode71JsonFeeder))]
    [MemberData(nameof(Opcode75JsonFeeder))]
    [MemberData(nameof(Opcode79JsonFeeder))]
    [MemberData(nameof(Opcode7DJsonFeeder))]
    [MemberData(nameof(OpcodeE9JsonFeeder))]
    [MemberData(nameof(OpcodeEDJsonFeeder))]
    [MemberData(nameof(OpcodeF9JsonFeeder))]
    [MemberData(nameof(OpcodeFDJsonFeeder))]
    public void BeExecutedCorrectly(SampleCpu sampleCpu)
    {
        var trace = new List<(int, byte, string)>();
        var sut = Utilities.CreateSubjectUnderTestFromSample(sampleCpu.Opcodes, sampleCpu.Initial, trace);
        sut.Run();

        Utilities.Equal(sampleCpu.Final, sut);
        Utilities.Equal(sampleCpu.Cycles, trace);
    }

